import React, { useState } from "react";
import "antd/dist/antd.css";
import { Modal, Button } from "antd";

function ModalFligh(props) {
  const [isModalVisible1, setIsModalVisible1] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  return (
    <div>
      <Modal
        title="Basic Modal"
        visible={props.isModalVisible1}
        onOk={handleOk}
        onCancel={props.handleCancel1}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Modal>
    </div>
  );
}

export default ModalFligh;
